// About Page
import React, { Component } from 'react'; //import React Component

const Devices = () => {
   return (
      <main>
         <nav aria-label="breadcrumb" className="breadcrumbs">
            <ol className="breadcrumb bg-transparent font-weight-light">
               <li className="breadcrumb-item"><a className="text-danger" href="/">Home</a></li>
               <li className="breadcrumb-item active" aria-current="page">Devices</li>
            </ol>
         </nav>

         <MainAboutSection />
      </main>
   );
}

class MainAboutSection extends Component {
   render() {
      return (
         <div className="py-4 about-page">
            <div className="text-center mb-4">
               <h1 className="display-4">Coming Soon...</h1>
              </div>
              <div className="font-weight-light mb-2">
                  <p>Sound Sustainability is is striving to develop the best over the counter hearing aid on the market. While still in development, we are so excited about our product so far. Follow us on social media for updates! </p>
              </div>
              <div className="col-sm-2 d-flex flex-column text-nowrap text-black">
                  <a href="https://www.facebook.com/SoundSustainability/" >
                      <i className="bi bi-facebook text-secondary"></i> Facebook
						</a>
                  <a  href="https://www.instagram.com/hearyourworld/" >
                      <i className="bi bi-instagram text-secondary"></i> Instagram
						</a>
                  <a href="https://twitter.com/hearyourworld" >
                      <i className="bi bi-twitter text-secondary"></i> Twitter
					</a>
                  <a  href="https://www.linkedin.com/company/soundsustainability" >
                      <i className="bi bi-linkedin text-secondary"></i> Linked In
						</a>
              </div>
         </div>
      );
   }
}

export default Devices;
